import React from 'react';
import Card from '@material-ui/core/Card'
import img1 from './static/qiuqiu_img/qiuqiu.jpg';



export default function Top() {
	const classes = useStyles();

	return (
		<Card>
			<img src={img1} alt="" width="500" height="600" />
		</Card>
	);
}
